sys_dictionary.calculation:
(function calculatedFieldValue(current) {
	var varString = '';
	var variables = current.variables.getElements(); 
	for (var i=0;i<variables.length;i++) { 
		var question = variables[i].getQuestion(); 
		if(!question.getValue().nil() && question.getValue() != 'false' && question.getValue() != ''){
			varString += '- ';
			varString += question.getLabel() + ":" + question.getDisplayValue();
			varString += '\r';
		}
	} 


	return varString;  // return the calculated value

})(current);
